// components/Login.js
import React, { useState } from 'react';
import realEstateLogo from '../images/realEstateLogo.png'; // Adjust the path as needed

const Login = () => {
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your password verification logic here
  };

  return (
    <div className="flex flex-col justify-center items-center min-h-screen bg-dark-gray text-white">
      <img src={realEstateLogo} alt="Real Estate Logo" className="h-40 mb-8" />
      <form onSubmit={handleSubmit} className="flex flex-col items-center">
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="mb-4 p-2 rounded"
          placeholder="Enter Password"
        />
        <button
          type="submit"
          className="bg-white text-navy py-2 px-4 rounded-lg"
        >
          Submit
        </button>
      </form>
    </div>
  );
};

export default Login;
